import { FunctionComponent, useState, useCallback, useEffect } from "react";
import PortalPopup from "../../Consultas/PortalPopup";
import style from "./css/ViewException.module.css"

type PropsComponente = {
  Mensagem: string;
}
const ViewException: FunctionComponent<PropsComponente> = (Mensagem) => {
    const [isModalUsuarioPopupOpen, setModalUsuarioPopupOpen] = useState(false);
    const [TxbUsuario, setUsuario] = useState("");

    const openModalUsuarioPopup = useCallback(() => {
        setModalUsuarioPopupOpen(true);
    }, []);

    const closeModalUsuarioPopup = useCallback(() => {
        setModalUsuarioPopupOpen(false);
    }, []);
    const ClearComponent = useCallback(() =>{
        setUsuario("");
    }, []);

    useEffect(() => {
        
    });
  return (
    <>          
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Top center"
          onOutsideClick={closeModalUsuarioPopup}
        >
           <div id="myModal" className={style.modal + " " + style.fade}>
                <div className={style.modal_dialog  + " " + style.modal_confirm}>
                    <div className={style.modal_content}>
                        <div className={style.modal_header}>
                            <div className="icon_box">
                                <i className="material_icons">&#xE876;</i>
                            </div>				
                            <h4 className="modal_title w_100">Awesome!</h4>	
                        </div>
                        <div className="modal_body">
                            <p className="text_center">Your booking has been confirmed. Check your email for detials.</p>
                        </div>
                        <div className="modal_footer">
                            <button className="btn btn-success btn_block" data-dismiss="modal">OK</button>
                        </div>
                    </div>
                </div>
            </div>   
        </PortalPopup>     
    </>
  );
};

export default ViewException;
